      console.log('click'); 
    }


  render(){
  return (
    <div className="App">
      <Particles className='particles' params={particleOptions}/>
      <Navigation/> 
      <Logo /> 
      <Rank/>
      <ImageLinkForm 
        onInputChange = {(this.onInputChange)} 
        onButtonSubmit={this.onSubmit}
      /> 
      {/*<FaceRecognition/> */}
    </div>
  );
}
}

export default App;
